import './Main.scss';
import khuLogo from '../../assets/icons/khu-logo.png';

function Main() {
    return (
        <div className="main">
            <img src={khuLogo}/>
            <div>
            <h1> KHUSINSA <br /> Inventory Management System</h1>
            </div>

        </div>
    );
}

export default Main;
